function myFunction(){var e=document.getElementById("previous-positions"),t=document.getElementById("toggle-previous-positions");e.style.display="block",t.style.display="none"}window.addEventListener("DOMContentLoaded",()=>{const e=new IntersectionObserver(e=>{console.log("hello"),e.forEach(t=>{const e=t.target.getAttribute("id");console.log(e),t.intersectionRatio>0?document.querySelector(`nav li a[href="#${e}"]`).parentElement.classList.add("active"):document.querySelector(`nav li a[href="#${e}"]`).parentElement.classList.remove("active")})});document.querySelectorAll("h2[id], h3[id]").forEach(t=>{e.observe(t)})})